declare module "node-rocketsms-api" {	type DataResponse = {		id: string;		[key: string]: unknown;	};	type ErrorResponse = {		message: string;		[key: string]: unknown;	};	type AuthOptions = {		username: string;		password: string;	};	class NodeRocketProvider {		private username;		private password;		constructor(private auth: AuthOptions);		public send(phone: string, body: string): Promise<DataResponse>;	}	export default NodeRocketProvider;	export type { AuthOptions, DataResponse, ErrorResponse };}